    false,nt"url": null,nt"notes": "This is a collection of documents related
    to four projects which were proposed by the U.S. Army, Corps of Engineers in the
    Yazoo River Basin. The Upper Yazoo Basin Projects include the Big Sand Creek Project,
    the Ascalmore Creek-Tippo Bayou Project, the Big Sand Creek Project, and the Panola-Quitman
    Floodway East Bank Levee. Upon completion, the Upper Basin Projects will entail
    over 245 miles of channelization, 250 miles of levees, 7 flood control structures,
    and over 100 drainage structures. The U.S. Fish and Wildlife Service believes that
    the impacts to fish and wildlife resources will be severe.",nt"license_title":
